import './App.css';

import Navbar from './Components/Navbar';
import Hero from './Components/Hero';
import Donation from './Components.Donation';

import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route, 
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Navbar></Navbar>

      <Switch>
        <Route path="/about">
          <Hero/>
        </Route>
        <Route path="/donation">
          <Hero/>
        </Route>
        {/* <Route path="/contact">
          <Hero/>
        </Route>
        <Route path="/account">
          <Hero/>
        </Route> */}
      </Switch>
      <Hero></Hero>
    </Router>
  );
}

export default App;
